import React, { Component } from "react";
import { Accordion, Card, Col, Row } from 'react-bootstrap';
import axios from "axios";

export class LetterPg extends Component {
  constructor(props, context) {
    super(props, context);
    this.state = {
      error: null,
      isLoaded: false,
      letter: []
    };
  }

  componentDidMount() {
    axios.all([
      axios.get('2008.json')])
      .then(axios.spread((getLetterData) => {
        console.log(getLetterData)
        const letter = getLetterData.data;
        this.setState({ letter });
        console.log(letter)
        console.log(this.state.letter[0].Code)
        this.setState({ isLoaded: true })
      }))
      .catch((err) => {
        this.setState({ isLoaded: false });
        this.setState({ error: err.message });
      });
  }

    render() {
        return (
          <div>
              <Row>
                  <h2>{this.state.letter.Code} {this.state.isLoaded}</h2>
              </Row>
          </div>
        )
    }
}

export default LetterPg;
